import ButtonComp from "@components/ButtonComp";
import IconComp from "@components/IconComp";
import { Formatters } from "@core/index";
import { ProductService } from "@services/index";
import { useEffect, useState } from "react";

export default function ClientProducts() {
    const [states, setStates] = useState({ products: [] })
    const getProductList = async () => {
        const response = await ProductService.getAllProducts()
        setStates({ ...states, products: response.data })
    }
    useEffect(() => {
        getProductList()
    }, [])
    return (<>
        <div className="flex flex-wrap gap-5">
            {
                states.products.map((prod, i) => (<div key={i} className="basis-1/5 flex-1 ">
                    <div className="bg-whiteBone p-3 w-full flex-2 grow">
                        <img
                            src={`data:image/png;base64,`}
                            className="" />
                        <div className="grid px-2 pt-4 pb-3">
                            <div>{prod.name}</div>
                            <div>$ {Formatters.moneyFormat(prod.price)}</div>

                            <ButtonComp
                                label={(
                                    <div className="flex"><IconComp icon='add_shopping_cart' className='text-[18px]' /> Agregar </div>
                                )}
                                className="!w-[75%] !mt-4 justify-self-end" />
                        </div>
                    </div>
                </div>))
            }
        </div>
    </>);
}